                    color="primary"
                    size="small"
                    startIcon={<NovoFuncionarioIcon />}
                    href="dadosfuncionarios"
                >
                    Inserir Novo Funcionário
                </Button>
                {/* <a style={{fontSize:"30px", fontWeight:"bold"}} >INSERÇÃO DE DADOS</a>
                <p/>
                <a href='dadosfuncionarios'>
                    Inserir Novo Funcionário
                </a> */}
            </div>
        )
    }
}
